import React, { useState } from 'react'

import SweetAlert from 'sweetalert2'
function Login() {
    
    const [enteredEmail, setUserEmail] = useState('saad@gmail.com')
    const [userPwd, setUserPwd] = useState('saad123')

    const handlerSubmit = e => {
        e.preventDefault()
        console.log(enteredEmail, userPwd);
    }

    return (
        <div className="small-container">
            <form onSubmit={handlerSubmit}>
                <h1>Admin Login</h1>
                <div>
                    <label htmlFor="email">Email</label>
                    <input type="text" onChange={ e => setEnteredEmail(e.target.value)} />
                </div>
                <div>
                    <label htmlFor="password">Password</label>
                    <input type="text" onChange={ e => setEnteredPwd(e.target.value)}/>
                </div>
                <div>
                    <input type="submit" value="Login"/>
                </div>
            </form>
        </div>
    )
}

export default Login
